import React, { useState } from 'react'
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButtons, IonBackButton, IonCheckbox, IonItem, IonLabel } from '@ionic/react';
import { logoLaravel } from 'ionicons/icons';

const checkboxList = [
    { val: 'Profesional', isChecked: false },
    { val: 'Streamer', isChecked: false },
    { val: 'Estandar', isChecked: false }
  ];


export const CrearPerfil = () => {

    const [checked, setChecked] = useState([]);
    setChecked(checkboxList);

    return (
        <IonPage>
      <IonHeader>
        <IonToolbar>

            <IonButtons slot="start">
              <IonBackButton defaultHref='/' text='regresar' />
            </IonButtons>
          <IonTitle>Tab 3</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>

    {checkboxList.map( ({val,isChecked }) => (
      <IonItem >
              <IonLabel>{val}</IonLabel>
              <IonCheckbox  slot="end" checked={isChecked}  />
      </IonItem>
    ))}


       
      </IonContent>
    </IonPage>
    )
}
export default CrearPerfil;
